            <p className='txt res-text'> <strong> {id} Reservation :</strong></p>
            <div className='txt res-info'>
                <p><strong>Book title: </strong>{title}
                <strong> Book type: </strong>{bookType}
                <strong> Is quick up: </strong>{isPickUp}
                <strong> Book reservation time: </strong>{days} {days === 1 ? 'day' : 'days'}
                <strong> Book return date: </strong>{reservationEnd}
                <strong> Total reservation cost: </strong>{totalPrice} â‚¬</p>
            </div>
        </div>
    );
}
